@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("4chan.org") {
body, .reply, .replyhl, .commentpostername, .postername, .postertrip, .filesize, .filetitle, span[id], .quotelink, a, a:active, a:visited {
font-family: georgia !important;
}
}
/* ALL BOARDS */
@-moz-document domain("boards.4chan.org") {
HTML {
	background: #EEF2FF ("data:image/png;base64,") top center repeat-x !important;
}
}
@-moz-document domain("boards.4chan.org"),domain("rs.4chan.org") {
#header {
	padding: 4px !important;
	width: 100% !important;
	position: fixed !important;
	top: 0px !important;
	left: 0px !important;
	z-index: 2 !important;
	height: 20px !important;
	text-align: center !important;
	font-size: 11pt !important;
	background: #EEEEEE !important;
	color: #999999 !important;
	border-bottom: 1px solid #DDDDDD !important;
}
#header a, #header, a:active, #header a:visited {
	color: #999999 !important;
	text-decoration: none !important;
}
#header a:hover {
	text-decoration: underline !important;
}
#navtop {
font-size: 10pt !important;
text-align: center !important;
width: 100% !important;
margin-top: 0.1em !important;
}
#navtopr { display: none !important; }
.postblock {
	background: #EEEEEE !important;
	color: #999999 !important;
	border-bottom: 1px solid #DDDDDD !important;
	padding: 4px !important;
}
#twi_table {
	background: #FAFAFA !important;
}
#twi_table_div {
	border: 1px solid #DDDDDD !important;
}
DIV[class="reply"] {
	background: #FAFAFA !important;
	border: 1px solid #DDDDDD !important;
}
img[height="100"][width="300"] {
	display: none !important;
}
div.logo {
	height: 150px !important;
	width: 1024px !important;
	padding: 0px !important;
	border-bottom: 1px solid #DDDDDD !important;
	margin-top: 0px !important;
	margin-bottom: 0px !important;
	background: url("data:image/jpeg;base64,") !important;
}
div.logo font[size="5"] {
	float: left !important;
	margin-left: 8px !important;
	font-size: 32pt !important;
	font-weight: bold !important;
	position: relative !important;
	bottom: -54px !important;
}
div.logo font[size="1"] {
	float: left !important;
	position: relative !important;
	bottom: -34px !important;
	padding-left: 16px !important;
	font-size: 14pt !important;
}
div.postarea hr {
	clear: left !important;
}
div.postarea {
	border-bottom: 1px solid #DDDDDD !important;
	height: 240px !important;
}
div[class="4chan_ext_thread"] {
	padding: 8px !important;
}
div[class="4chan_ext_thread_replies"] {
	border-top: 1px solid #DDDDDD !important;
	clear: both !important;
}
TABLE[class="4chan_ext_reply"] {
	width: 100% !important;
	background: #FFFFFF !important;
	border-bottom: 1px solid #DDDDDD !important;
	color: #000000 !important;
}
TD[class="reply"] {
	background: #FFFFFF !important;
	color: #000000 !important;
}
body {
	background: #FFFFFF !important;
	width: 1024px !important;
	padding: 0px !important;
	margin: 0px auto !important;
	border: 1px solid #DDDDDD !important;
	border-top: 0px !important;
	color: #000000 !important;
}
TABLE[cellspacing="1"][cellpadding="1"] {
	float: left !important;
	margin-left: 24px !important;
	margin-bottom: 24px !important;
}
HTML > BODY > FORM {
	clear: left !important;
}
HR {
	display: none !important;
}
.doubledash, .rules {
	display: none !important;
}
DIV[class="4chan_ext_thread"] > A:first-child + SPAN + SPAN + BR + A > IMG, DIV[class="4chan_ext_thread"] > IMG:first-child + A + SPAN + SPAN + BR + A + A > IMG, DIV[class="4chan_ext_thread"] > IMG:first-child + A + SPAN + SPAN + BR + A > IMG, DIV[class="4chan_ext_thread"] > A:first-child + SPAN + SPAN + BR + A + INPUT + SPAN + SPAN + SPAN + SPAN + SPAN + BR + A > IMG:last-child, DIV[class="4chan_ext_thread"] > A:first-child + SPAN + SPAN + BR + A + A > IMG {
	border: 2px solid #DDDDDD !important;
	margin: 12px !important;
} 
.replyhl {
	background: #FAFAFA !important;
}
.replytitle, .filetitle {
	font-size: 14pt !important;
	font-family: georgia !important;
	margin-right: 4px !important;
}
.commentpostername, .postername {
	font-size: 13pt !important;
}
blockquote {
	font-size: 12pt !important;
	margin-top: 18px !important;
	margin-bottom: 18px !important;
	color: #000000 !important;
}
a.quotejs:active, a.quotejs:link, a.quotejs:visited {
	color: #000000 !important;
	text-decoration: none !important;
}

a.quotejs:hover {
	color: #000000 !important;
}
TD[class="reply"] > A > IMG, TD[class="replyhl"] > A > IMG {
	border: 2px solid #DDDDDD !important;
	margin: 12px !important;
}
SPAN[class="omittedposts"], SPAN[class="filesize"] {
	font-style: italic !important;
	color: #777777 !important;
	font-size: 11pt !important;
}
SPAN[class="omittedposts"] {
	font-size: 13pt !important;
}
#twi_table {
	color: #000000 !important;
}
#twi_table SPAN[class="postername"], #twi_table SPAN[class="filetitle"] {
	font-size: 9pt !important;
}
a, a:visited {
	color: #34345C !important;
}
a:hover {
	color: #DD0000 !important;
}
a.quotelink {
	color: #DD0000 !important;
}
img[src^="chrome://4chan/skin/buttons/"],img[alt="Locked"],img[alt="closed"] {
height:0 !important;
margin:0 0px !important;
padding-top:18px !important;
width:18px !important;
background-color:transparent !important;

}
